import React from 'react';

const Card = ({name, link, likes, ...rest}) => {

  return(
    <li className="photo-card">
      <button type="button" className="photo-card__trash-icon" value=""></button>
      <img className="photo-card__image" src={link} alt={name} onClick={rest.onClick.name}/>
      <div className="photo-card__footer">
        <h3 className="photo-card__title">{name}</h3>
          <div className="photo-card__like-container">
            <button type="button" className="photo-card__like-icon"></button>
            <p className="photo-card__like-counter">{likes.length}</p>
          </div>
      </div>
    </li>
  );
}

export default Card;
